def remove_range(head, start, end):
    assert start <= end
    if start == 0:
        for i in range(0, end + 1):
            if head != None:
                head = head.next
    else:
        current = head
        for i in range(0, start - 1):
            current = current.next
        for i in range(0, end - start + 1):
            if current != None and current.next != None:
                current.next = current.next.next
    return head
